/**
 * artist
 * album
 * genre
 * release_date
 * label
 * price
 * tracklist
 * cover_image
 */
const InventoryList = ({products}) => {

  return (
    <div>
      {products.map(p => (
        <div key={p.id}>
          <table>
            <thead>
              <tr></tr>
            </thead>
          </table>
          
        </div>
      ))}
      
    </div>
  );
}; export default InventoryList;
